Way of War, The (2008)  

Verenigde Staten
Actie / Thriller
87 minuten

geregisseerd door John Carter
met J.K. Simmons, Cuba Gooding Jr. en Edrick Browne

The Way of War gaat over een soldaat (Cuba Gooding Jr.), die achter een samenzwering komt die voor een nieuwe oorlog kan zorgen. Na de ontdekking hiervan, besluit hij daartegen te vechten.


